import React from "react";
import "./Contact.css";
import { Link } from "react-router-dom";

let Contact = () => {
  return (
    <>
      <div className="contact-container">
        <div className="contact-box">
          <div className="contact-icon-box">
            <div className="contact-icon">
              <img src="./Images/mail.jpg" text="mrvdparmar96@gmail.com"></img>
              <p>mrvdparmar96@gmail.com</p>
            </div>
            <div className="linkdin-icon">
              <img
                src="./Images/linkdin.png"
                href="{https://www.linkedin.com/in/vishal-parmar-b01277297/}"
              ></img>
              <p>https://www.linkedin.com/in/vishal-parmar-b01277297/</p>
            </div>
          </div>
          <div className="contact-content"></div>
        </div>
      </div>
    </>
  );
};
export default Contact;
